import React from 'react'
import './nav.css';

const Header = () => {
  return (
    <div className="bar" >
        <h className='logo'>Grievance</h>
        <div>
        <h5 style={{paddingLeft:"350px",backgroundColor:"aqua",height:"10px",paddingTop:"0px"}}>Login</h5>
        </div>
    </div>
  )
}

export default Header
